(1311, 'Bouvier', 'nicolasbouvier94@hotmail.com', NULL, 'abcf2e8a3664497376bd4e9ff860ea6b', NULL, NULL, '2019-08-08 09:05:48', 'Nicolas', 'Bouvier!!!', 'nibouvier', '1994-09-24', 'Quai du Condroz, n°9', 'Liège', 4000, '0474445899', 2012, 2013, '', '-lésions au niveau des tissus sensitifs et moteurs de la main gauche (c\'est pourquoi je n\'ai pas pu faire mon baptême plus tôt...)\r\n-ne me donnez surtout pas de boissons énergisantes (ok pour le café mais pour le reste, les effets sont décuplés et je deviens difficilement contrôlable) ', 'PHYSIQUEMENT: je suis le prototype même du petit bûcheron aux yeux bleu. De plus, j\'ai souvent un petit sourire en coin (\"d\'imbécile heureux\" qui ne plait pas à tout le monde...).\r\nCOMPORTEMENT: je suis un écologiste limite extrémiste qui ne consommera JAMAIS dans un fast-food (et ce quel que soit mon état) ! J\'ai bcp de mal à dire non quand il s\'agit d\'aider qqun (bonne poire quoi!)\r\nAUTRE: mémoire de poisson rouge et parle parfois au subjonctif quand je suis bourré...', 6, 'Bouvier_Nicolas.jpg', '', '\"Ceci est entièrement vrai puisque je viens de l\'inventer\" Boris Vian', '', 'SA Saint', '', '0000-00-00 00:00:00', 'Bouvier!!!'),
