(1318, 'Deprez', 'xavx95@hotmail.com', NULL, 'a2f33a3db1535b9ead7c369e3787ca32', NULL, NULL, '2019-08-08 09:05:48', 'Xavier', 'Deprez', 'xadeprez', '1995-08-14', '3 rue richard orban', 'berloz', 4257, '0494588837', 2013, 2013, '', 'allergie aux sparadraps non ipoalergéniques', 'petit mais passionné, cheveux bruns dont la taille dépend de l\'humeur et les yeux verts. Je veux me faire baptiser pour faire partie intégrante du folklore estudiantin et m\'y donner corps et âme... et aussi pour suivre la lignée familiale ^^.', 6, 'Deprez_Xavier.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Deprez'),
(1319, 'Moreau', 'thomasmoreau91@gmail.com', NULL, 'ffffb58a816bb7bc5c1c7d330120fa04', NULL, NULL, '2019-08-08 09:05:48', 'Thomas', 'AEES', 'thmoreau', '1991-12-23', 'Rue du puits 66', 'Cointe', 4000, '0491080931', 2010, 2013, '', 'Hydrocéphalie => Dérivation ventriculo-péritonéale. J\'ai un dossier médical à vous fournir. Engelen est au courant.\r\nSi j\'ai une grosse migraine j\'ai une injection à me faire.\r\n\r\nSphérocytose => J\'ai souvent le teint jaune. On m\'a retiré la vésicule biliaire. Du coup, j\'ai plus de mal pour digérer certains trucs.', '', 6, 'Moreau_Thomas.jpg', 'Ingénieur civil mécanicien', '', '', '', '', '0000-00-00 00:00:00', 'Moreau'),
