(1387, 'Bertin', 'claire.bertin@outlook.com', NULL, '306b9531018833fd9ac5d588bd450e7a', NULL, NULL, '2019-08-08 09:05:48', 'Claire', 'Jabiru', 'clbertin', '1997-04-14', '25 rue du Vieu Mayeur', 'Liège', 4000, '0491422069', 2015, 2015, '', 'Problème respiratoire, risque de crise (ça ressemble à de l\'hyper ventilation, accompagnée de douleurs aux poumons et au cœur, à une crise de panique). La cause de ces crises est encore inconnue. En cas de début crise, j\'ai des médicaments à prendre pour éviter que ça devienne grave (perte de conscience, hyperventilation, crise de panique). Si jamais je prends les médicaments trop tard (ou pas du tout), il faut juste attendre que ça passe. En cas de perte de conscience, je tiens debout, mais il vaut mieux me forcer à m\'allonger à l\'extérieur et dans un endroit plus ou moins calme pour que je puisse \"reprendre le contrôle\", et attendre que je revienne à moi. Il est TRES important que la personne qui est avec moi dans ce cas reste calme et me parle (de n\'importe quoi, c\'est juste pour m\'aider à retrouver le contrôle)\r\nIl y a très peu de risque que je fasse une crise grave, j\'ai l\'habitude de gérer ça. Mais donc ne vous étonnez pas si  je demande de l\'eau pour prendre mon médicament, en général, je suis mal pendant 5minutes après l\'avoir pris et puis ça va.\r\nSi vous n\'avez rien compris à cette explication un peu bancale, je peux réexpliquer, mais c\'est vraiment très compliqué...\r\n\r\nA retenir: si je prends mes médicaments à temps, normalement tout va bien :)', '', 6, 'Bertin_Claire.jpg', '', 'Honnête', 'Perroquets #aupluriel', '', 'Secrétaire & trésorière de la Team Grosse-Bouffe', '0000-00-00 00:00:00', 'Claire'),
