(1564, 'Mathieu', 'juliette.mathieu06@gmail.com', NULL, 'a99d3fe9cc0015d22a5f79dc4e720a0b', NULL, NULL, '2019-08-08 09:05:48', 'Juliette', '', 'majuliette', '1998-07-06', 'Royompre 5', 'Jalhay', 4845, '0473539903', 2017, 2017, '', 'Psoriasis et arthrite psoriasique.\r\nL\'arthrite psoriasique est une maladie des articulations liée au psoriasis.  J\'alterne les périodes de rémission (périodes où j\'ai rien du tout) et les périodes de poussée (durant lesquelles j\'ai des problèmes aux articulations). Cette maladie est liée au psoriasis, ce qui veut dire que si j\'ai des taches sur la peau, je suis dans un période de poussée (bon après il y a des nuances entre taches actives et taches passives mais c\'est long à expliquer). Néanmoins, même si je suis dans un période de poussée, il y a des jours ou  j\'ai moins mal, malheureusement si je force trop après un moment j\'ai mal, raison pour laquelle parfois je suis capable de me mettre à genoux et parfois pas. Merci d\'avoir tout lu.', 'Chiante mais adorable (c’est parrain qui l’a dit)', 6, 'Mathieu_Juliette.jpg', '', 'Free your mind and your ass will follow/ mais ça compte pas j étais bourrée ', 'get 27', '', '', '0000-00-00 00:00:00', ''),
