(1625, 'Galet', 'maxime.galet@gmail.com', NULL, '73ddc7f652234773c249539bd11c6109', NULL, NULL, '2019-08-08 09:05:48', 'Maxime', 'Galet', 'magalet', '2000-07-25', '283 Grand Route', 'Flémalle', 4400, '0497071334', 2017, 2018, '', 'Allergie aux sulfamidés. Fracture à la jambe droite mal soignée. Opération     du coeur à 9ans.', 'J\'adore l\'eau et la karmeliet', 6, 'Galet_Maxime.jpg', 'Ingénieur civil électricien', 'J\'adore me beurrer la biscotte', 'Tripel karmeliet', '4h trottis', '', '0000-00-00 00:00:00', 'Maxime Galet'),
(1626, 'Kozlowska ', 'natikozlo@hotmail.com', NULL, 'e0f966941289ff0ad3e20c4458244cfb', NULL, NULL, '2019-08-08 09:05:48', 'Natalia ', 'Machin Kozlowska', 'nakozlowska', '1999-08-17', 'Place des déportés 18 ', 'Liège ', 4000, '0470786422', 2018, 2018, '', 'Forte allergie aux guêpes ', 'Je suis brune, de taille normale et j’ai les yeux bleus/gris. \r\nJe fais mon baptême car j’aimerais rencontrer les gens chouettes qu’ont l’air d’être les inges, vivre une nouvelle expérience, me surpasser, être mieux intégrer dans ma faculté et apprendre à guindailler comme des vrais liégeois! Je suis originaire de Pologne, la vodka coule déjà à flots dans mon sang mais je ne pense pas etre encore au niveau des guindailleurs de la cité ardente!! \r\nJe veux aller jusqu’au bout de mon baptême pour me prouver que j’en suis capable et pour avoir mon propre vécu de cette expérience qui est tant jugée avec des rumeurs inventés ', 6, 'Kozlowska_Natalia.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Natalia  Kozlowska '),
(1627, 'Lipcsei', 'helene.lipcsei@gmail.com', NULL, '43dd88f6cf0e2c823148e65c3942dbec', NULL, NULL, '2019-08-08 09:05:48', 'Hélène', '', 'helipcsei', '2000-02-02', 'Darchis, 55', 'Liege', 4000, '+32499299673', 2017, 2018, '', '- allergie au lactose et  à la caséine (ça me rend malade mais si c\'est en toute petite quantité ça me fait quasi rien)\r\n- intolérance légère au gluten (j\'évite surtout d\'en manger pour ne pas développer d\'allergie sérieuse, je bois quand même de la bière quand j\'ai pris des probiotiques avant)\r\n- scoliose et douleurs au dos (j\'ai quelques contre indications mais c\'est surtout  sur le long terme donc dans ce cas-ci ça ne devrait pas poser beaucoup de problèmes)', '', 6, 'Lipcsei_Helene.jpg', '', 'C\'était pas moi c\'était Patricia', '', '', 'Co-présidente et membre fondatrice de la Team Scandale 2018', '0000-00-00 00:00:00', ''),
(1629, 'Vanhove', 'emilievanhove@yahoo.fr', NULL, '0f2956731a036924c0110057206c988d', NULL, NULL, '2019-08-08 09:05:48', 'Emilie', '', 'emvanhove', '1999-01-08', 'Rue Damry 102', 'Boncelles', 4100, '0494290480', 2017, 2018, '', 'Pré-diabète', '', 6, 'Vanhove_Emilie.jpg', '', 'Malgré toutes ces bouteilles de rhum, tous les chemins mènent à la dignité', 'Kasteel rouge', '', 'Co-présidente et membre fondatrice de la Team Scandale 2018\r\nChanteuse en chef de l\'année 2018', '0000-00-00 00:00:00', 'Vanhove'),
(1630, 'Vanraes', 'Valentin.vanraes@gmail.com', NULL, '1109309fb48ddc051a18d94085186fdc', NULL, NULL, '2019-08-08 09:05:48', 'Valentin', 'Vanraes ', 'vavanraes', '1970-01-01', 'Rue des Franchimontois N12', 'Liège', 4000, '0474045003', 2018, 2018, '', 'Allergie au Pollen ', 'Bon, physiquement il y a une particuliarité qui n’apparait pas sur la photo, j’ai une grosse cicatrice qui coupe mon torse... La vie m’a clairement dis « jamais tu vas respirer sale batard » ! Déjà tu vas naître avec un demi diaphragme car en vrai c’est un organe qui sert à rien, tu peux très bien respirer sans hein , et puis quand tu seras tranquillement posé dans ton salon, sans aucune raison BIM, poumon shot, de l’air se glisse prêt de ton poumon et le comprime... Mais je ne voulais pas clamser avant d’avoir fait mon baptême! Heureusement je peux à présent mener une vie tout à fait normale ( c’est à dire guindailler, guindailler, et encore guindailler ), et je suis très motivé à faire mon baptême ! Même si je sais que ça va être très difficile et que je vais devoir dépasser mes limites,  je pense que ça restera des moments inoubliables passé entre co-bleu et que des liens incassables en seront tissé (dans la souffrance...)', 6, 'Vanraes_Valentin.jpg', '', '', 'Perroquet, Curtius', 'P\'tit dej ingé, BBQ ingé', '', '0000-00-00 00:00:00', 'Valentin Vanraes'),
