(1644, 'Lemarchand', 'maximelemarchand00@gmail.com', NULL, '6d07336b93cf0ec91b543367cee3279b', NULL, NULL, '2019-08-08 09:05:48', 'Maxime', 'Lemarchand', 'malemarchand', '1970-01-01', 'Chemin du bois,88 Rocourt', 'Liège', 4000, '0492316596', 2018, 2018, '/', 'Port de lentilles mensuelles.\r\n', 'Je suis de Liège et je ne me voyais pas entrer à l\'unif sans faire mon baptême. J\'en ai souvent entendu parler et j\'avais envie de voir comment ça se passait de mes propres yeux avant de juger. Je suis très motivé pour arriver au bout. J\'ai surtout envie de sortir de ma zone de confort et de faire beaucoup de rencontres. Au niveau de mon caractère je ne suis pas prise de tête et encore moins un stressé. Je suis grand brun et j\'ai un reste de colo sur l’avant de mes cheveux.', 6, 'Lemarchand_Maxime.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Lemarchand'),
