(1652, 'Braida', 'mbraida147@gmail.com', NULL, 'e9939bc7b46a44a6deb16f7c6888e0d3', NULL, NULL, '2019-08-08 09:05:48', 'Martin', '', 'mabraida', '2001-02-07', 'Rue de Poulseur 20', 'Esneux', 4130, '0492703621', 2018, 2018, '/', 'J\'ai eu de l\'asthme il y a un moment mais ça fait longtemps que je n\'en ai plus fait! J\'ai également eu des problèmes de dos l\'année passée, j\'ai fait beaucoup de kiné donc ça va mieux mais si je force dessus ça risque de revenir.', '2001 de merde mais toujours présent pour se mettre la pire, je suis ultra sociable et sympa! Et si un co-bleu a un quelconque soucis, je serai toujours là pour l’aider.', 6, 'Braida_Martin.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Martin Braida'),
(1654, 'Buccoleri', 'adrian.buccoleri@live.be', NULL, '078ed64865fd0cd041902f4316d4f22e', NULL, NULL, '2019-08-08 09:05:48', 'Adrian', 'Macaroni', 'adbuccoleri', '2000-06-15', 'Rue des berlaines, 2', 'Saint-Nicolas', 4420, '0472248132', 2018, 2018, '', '', 'Physiquement normal (à part mes deux pieds gauches mais ça me gêne seulement pour danser) , je suis motivé a 100% pour faire mon baptême, vivre cette expérience à fond, rencontrer beaucoup de gens et surtout m\'éclater un max !\r\nBon mangeur, bon buveur, je sais faire les pâtes, les pizzas, les pâtes à pâtes, les pâtes à pizzas (apparemment il y en bcp qui aime).\r\nJe suis quelqu\'un de sympathique, même si un peu timide. \r\nPersonne ne m\'a spécialement motivé à le faire, même si dans ma famille plusieurs sont déjà baptisés. Ça fait depuis longtemps que je suis décidé à le faire. ', 6, 'Buccoleri_Adrian.jpg', '', 'Mange tes morts', 'Triple Karmeliet, Bière', '', '', '0000-00-00 00:00:00', 'Adrian Buccoleri'),
