(1657, 'Collignon', 'victoriacollignon@yahoo.fr', NULL, '5686e903a7adae5d8c2a8909dd785d17', NULL, NULL, '2019-08-08 09:05:48', 'Victoria', 'Machin Collignon', 'vicollignon', '1998-07-15', 'Allée de la Cense Rouge, 28', 'Angleur', 4031, '0479062220', 2016, 2018, '', 'Sous Roaccutane -> divers effets secondaires complètement random + je ne pourrai pas faire mon don de sang.', 'Grande brune\r\nJe fais mon baptême pour découvrir mes limites et créer des liens solides avec mes futurs co-bleus.', 6, 'Collignon_Victoria.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Machin Collignon'),
