(1661, 'Leduc', 'charline.leduc@student.uliege.be', NULL, '4635315425d7e3f2536c43f56d8921f7', NULL, NULL, '2019-08-08 09:05:48', 'Charline', 'Leduc', 'chleduc', '1970-01-01', 'Rue de la China numéro 57 ', 'Louveigné', 4141, '0471559525', 2018, 2018, '', 'Je fais une sorte de crise d\'épilepsie qui est surtout dû à la fatigue mais aussi au stress. Lorsque j\'en fais une (je tombe inconsciente, j\'hyperventile,je tremble, je fais des apnées respiratoires,..) j\'aurai toujours du TEMESTA dans ma poche (une petit pastille blanche), il faut m\'en mettre un en dessous de la langue. Ne surtout pas appeler l\'ambulance même si cela peut être parfois impressionnant. Cela peut durer jusqu\'à 20 minutes, mais logiquement je n\'en ferai pas pendant le baptême. De plus, je suis allergique aux Champignons. ', 'Je suis blonde avec des lunettes, je mesure 1m70. Le baptême est pour moi un passage important afin d\'être à 100% impliquée dans ma faculté. Je suis souriante.Lorsque je suis en grand groupe, je ne parle pas spécialement beaucoup.. Je suis compétitive. \r\n\r\n', 6, 'Leduc_Charline.jpg', '', '', '', '', '', '0000-00-00 00:00:00', 'Leduc'),
